import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import {Table} from './Components/Table'
import {Selector} from './Components/Selector'
import NumberField from './Components/NumberField'

const options = [
  { value: 'B', label: 'Binomial' },
  { value: 'BN1', label: 'Binomial Negativa (v1)' },
  { value: 'BN2', label: 'Binomial Negativa (v2)' },
  { value: 'G', label: 'Geométrica' } ,
  { value: 'Pascal', label: 'Pascal' },
  { value: 'H', label: 'Hipergeométrica' },
  { value: 'P', label: 'Poisson' },
];


class App extends React.Component {
  constructor(){
    super();

    this.state = {
        distribution: null,
    }
  }

  changeDistribution = event =>{
    this.setState({distribution: event.target.value});
  }

  changeInput= event => {
    this.setState({name: event.target.value})
  }

  render(){
    return (
      <div className = "PROB"> 
        <Selector />
        <NumberField/>
        <Table _media={1} _varianza={2}/>
        <p>Select: {this.state.distribution}</p>
      </div>
    );
  }
}

var element = React.createElement('h1', { className: 'greeting' }, 'Hello, world!');
ReactDOM.render(element, document.getElementById('root'));

export default App;
